import React , {Component} from 'react';
import './App';

class App extends Component{
  render(){
    return(
      <div>
        <Header title="Hellooo!!"/>
        <p>Hello React</p>

      </div>
    )
  };
}

class Header extends Component{
  render(){
    return(
      <div>
      <Header>ReactJs{this.props.title}</Header>
      </div>
    )
  }
}
export default App;
